"Magnit delivery" is an application for home delivery of groceries from Magnit. For residents of Moscow and Krasnodar. Magnit is now at your home!

In the application:
• no more heavy packages – we will bring purchases directly to the door and hand them over without contact;
• we will select goods as for ourselves. And if something is out of stock – we will offer a worthy replacement!

In the new application "Magnit Delivery" you can:
• order groceries from 5,000 names with home delivery in Moscow and 25,000 names with home delivery in Krasnodar
• pay for the order by card in the application;
• register and store order history;
• receive push notifications with order status;
Also you can set up notifications, read privacy policies and contact support in personal account.

Delivery terms in Moscow:
• within 60 minutes within the MKAD;
• daily from 8:00 to 22:00;
• delivery cost from 49 rubles and free for orders over 999 rubles;
• weight limit – 30 kg.

Delivery terms in Krasnodar:
• after 3 hours at the same day, or at 60 min time interval 
• daily from 10:00 to 22:00;
• minimum order amount is 500 rubles;
• delivery cost 199 rubles and free for orders over 3000 rubles; 
• weight limit – 50kg.

Додаток Osama sushi - це зручний і швидкий сервіс доставки. 
Встановлюйте додаток Osama sushi та отримуйте онлайн-доступ до нашого сервісу доставки в будь-який час і в будь-якому місці.

Використовуючи додаток, ви можете:

• самостійно замовити страви з меню:
• встановити бажаний час доставки замовлення за вказаною адресою;
• вибрати зручний спосіб оплати;
• додати та зберегти адреси для доставки;
• формувати wish-лист;
• дізнаватись про діючі акції.

З додатком Osama sushi замовляти роли, сети легко, оскільки в додатку доступні детальні описи і фотографії страв.

Заказывайте еду

– чем больше сумма заказа на доставку, тем больше баллов вы заработаете;
– пример: сумма заказа составила 42 рубля 80 копеек, вам будет начислено 86 баллов;
– при заказе через приложение баллы удваиваются!
– баллы начисляются в течение 24 часов с момента доставки еды;
– баллы можно использовать для заказа любимых блюд или на подарки в сувенирной лавке.

Бронируйте столики

– чем больше гостей придёт по каждой вашей брони, тем больше баллов вы заработаете за посещение заведения;
– например, за бронь 2 гостя вы заработаете 40 баллов, а за бронь на 10 гостей — 200 баллов;
– баллы начисляются после подтверждения количества гостей заведением.

Добавляйте фото интерьера заведений и блюд

– только уникальные фотографии вашего авторства, удобно добавлять прямо с телефона;
– одна фотография = 2 балла, баллы начисляются на аккаунт после проверки фотографий.

Пишите отзывы о ресторанах и службах доставки

– один отзыв о заведении = 5 баллов;
– один отзыв с прикреплённым чеком = 10 баллов;
– развёрнутый отзыв (более 500 символов), с чеком = 20 баллов.
